int DynamicAlgRTM::sign(double value)
{
    if (value >= 0)
    {
        return 1;
    }
    else if (value < 0)
    {
        return -1;
    }

}

bool DynamicAlgRTM::getMatrixInverse(const double src[LINKS][LINKS], int n, double dest[LINKS][LINKS])
{
    double rank = getMatrixRank(src, n);

    if (rank < DYN_DOUBLE_ACCURACY && rank > -DYN_DOUBLE_ACCURACY)
    {
        return false;
    }

    double adjoint_matrix[LINKS][LINKS] = {0};
    getAdjointMatrix(src, LINKS, adjoint_matrix);

    for (int i = 0; i < n; ++i)
    {
        for (int j = 0; j < n; ++j)
        {
            dest[i][j] = adjoint_matrix[i][j]/rank;
        }
    }

    return true;
}

double DynamicAlgRTM::getMatrixRank(const double src[LINKS][LINKS], int n)
{
    if (n == 1)
    {
        return src[0][0];
    }
    double sum = 0;
    double temp[LINKS][LINKS] = {0};

    for (int i = 0; i < n; ++i)
    {
        for (int j = 0; j < (n - 1); ++j)
        {
            for (int k = 0; k < (n - 1); ++k)
            {
                temp[j][k] = src[j + 1][(k >= i)?(k + 1):k];
            }
        }
        double rank = getMatrixRank(temp, (n - 1));
        if (i % 2 == 0)
        {
            sum += src[0][i] * rank;
        }
        else 
        {
            sum -= src[0][i] * rank;
        }
    }

    return sum;
}

void DynamicAlgRTM::getAdjointMatrix(const double src[LINKS][LINKS], int n, double dest[LINKS][LINKS])
{
    if (n == 1)
    {
        dest[0][0] = 1;
        return;
    }

    double temp[LINKS][LINKS] = {0};
    for (int i = 0; i < n; ++i)
    {
        for (int j = 0; j < n; ++j)
        {
            for (int k = 0; k < (n - 1); ++k)
            {
                for (int m = 0; m < (n - 1); ++m)
                {
                    temp[k][m] = src[(k >= i)?(k + 1):k][(m >= j)?(m + 1):m];
                }
            }
            dest[j][i] = getMatrixRank(temp, (n - 1));
            if ((i + j) % 2 == 1)
            {
                dest[j][i] = -dest[j][i];
            }
        }
    }
    return;
}


bool DynamicAlgRTM::getMatrixLUInverse(const double src[LINKS][LINKS], int n, double dest[LINKS][LINKS])
{
    bool ret = false;
    double A[LINKS * LINKS] = {0};
    for (int i = 0; i < n; ++i)
    {
        for(int j = 0; j < n; ++j)
        {
            A[i*n + j] = src[i][j];
        }
    }

    double A_copy[LINKS * LINKS] = {0};//创建输入矩阵的副本，不用原始矩阵，因LUP分解算法已将其改变
    double inv_A[LINKS * LINKS] = {0};
    double inv_A_each[LINKS] = {0};//column of final inverse
    double b[LINKS] = {0};//b阵为B[LINKS][LINKS]阵的列矩阵分量

    double L[LINKS * LINKS] = {0};
    double U[LINKS * LINKS] = {0};
    int P[LINKS] = {0};

    for (int i = 0; i < n; ++i)
    {
        //构造单位阵的每一列
        for (int j = 0; j < n; ++j)
        {
            b[j] = 0;
        }
        b[i] = 1;
         
        //每次都需要重新将A复制一份
        for (int j = 0; j < n*n; ++j)
        {
            A_copy[j] = A[j];
        }
        
        ret = matrixLUPDecomposition(A_copy, L, U, P);
        if(ret == false)
        {
            return false;
        }

        matrixLUPSolve(L, U, P, b, inv_A_each);

        memcpy((inv_A + i * LINKS), inv_A_each, LINKS * sizeof(double));//将各列拼接
    }
    matrixTranspose(inv_A, LINKS, LINKS);

    for (int i = 0; i < LINKS; ++i)
    {
        for (int j = 0; j < LINKS; ++j)
        {
            dest[i][j] = inv_A[i*LINKS + j];
        }
    }

    return true;
}
bool DynamicAlgRTM::matrixLUPDecomposition(double A[LINKS*LINKS], double L[LINKS*LINKS], double U[LINKS*LINKS], int P[LINKS])
{
    int row = 0;
    for (int i = 0; i < LINKS; ++i)
    {
        P[i] = i;
    }

    for (int i = 0; i < (LINKS - 1); ++i)
    {
        double p = 0.0d;
        for (int j = i; j < LINKS; ++j)
        {
            if(fabs(A[j*LINKS + i]) > p)
            {
                p = fabs(A[j*LINKS + i]);
                row = j;
            }
        }
        if (0 == p)
        {
            //std::cout<<"singualarity"<<std::endl;
            return false;
        }

        //exchang P[i] and P[row]
        int tmp_P = P[i];
        P[i] = P[row];
        P[row] = tmp_P;

        double tmp_A = 0.0d;
        for (int j = 0; j < LINKS; ++j)
        {
            //exchang A[i][j] and A[row][j]
            tmp_A = A[i*LINKS + j];
            A[i*LINKS + j] = A[row*LINKS + j];
            A[row*LINKS + j] = tmp_A;
        }

        //LU matrixLUPDecomposition
        double u = A[i*LINKS + i], l = 0.0d;
        for (int j = i+1; j < LINKS; ++j)
        {
            l = A[j*LINKS + i] / u;
            A[j*LINKS + i] = l;
            for(int k = i+1; k < LINKS; ++k)
            {
                A[j*LINKS + k] = A[j*LINKS + k] - A[i*LINKS + k]*l;
            }
        }
    }

    //construct L and U
    for(int i = 0; i < LINKS; ++i)
    {
        for (int j = 0; j <= i; ++j)
        {
            if(i != j)
            {
                L[i*LINKS + j] = A[i*LINKS + j];
            }
            else
            {
                L[i*LINKS + j] = 1;
            }
        }
        for (int k = i; k < LINKS; ++k)
        {
            U[i*LINKS + k] = A[i*LINKS + k];
        }
    }
    return true;
}

bool DynamicAlgRTM::matrixLUPSolve(const double L[LINKS*LINKS], const double U[LINKS*LINKS], const int P[LINKS], const double b[LINKS], double inv_A_column[LINKS])
{
    double x[LINKS] = {0};
    double y[LINKS] = {0};

    //direct exchange
    for(int i = 0; i < LINKS; ++i)
    {
        y[i] = b[P[i]];
        for (int j = 0; j < i; ++j)
        {
            y[i] = y[i] - L[i*LINKS + j] * y[j];
        }
    }

    //inverse exchange
    for (int i = LINKS-1; i >= 0; --i)
    {
        x[i] = y[i];
        for (int j = LINKS-1; j > i; --j)
        {
            x[i] = x[i] - U[i*LINKS + j] * x[j];
        }
        x[i] /=U[i*LINKS + i];
    }

    for (int i = 0; i < LINKS; ++i)
    {
        inv_A_column[i] = x[i];
    }

    return true;
}

bool DynamicAlgRTM::matrixTranspose(double matrix[LINKS*LINKS], int m, int n)
{
    for(int i = 0; i < m*n; ++i)
    {
        int next = ((i % n) * m + i / n);
        while(next > i)
        {
            next = ((next % n) * m + next / n);
        }
        if(next == i)
        {
            double temp = matrix[i];
            int cur = i;
            int pre = ((cur % m) * n + cur / m);
            while(pre != i)
            {
                matrix[cur] = matrix[pre];
                cur = pre;
                pre = ((cur % m) * n + cur / m);
            }
            matrix[cur] = temp;
        }
    }

}


